The project will involve the construction of a new domestic-Principal Class 1[1] airport of international standards in Daraga, Alabay to replace the existing Legazpi Airport due to its limitations and safety concerns. It involves the following:
  a. Construction of landside and airside facilities;
  b. Passenger and cargo terminal buildings and related facilities/equipment;
  c. Security and navigational aids equipment;
  d. Detailed engineering design; and
  e. Land acquisition for the airport compound.

The project scaling up will cover 18 new barangays in 18 municipalities covered by the ongoing CHARMP 2 in the Cordillera Region.  Also, the Social Mobilization and Participatory Investment Planning component of the project has additional activities to be implemented in the 9 barangays already covered under CHARMP 2.  Project components include:

a. Social Mobilization and Participatory Investment Planning;
b. Agroforestry Development;
c. Agriculture Agribusiness and Income Generating Activities (AAIGA); and
d. Rural Infrastructure Development (RID)

The Program will develop institutional capacity and strengthen critical systems essential for improving equitable access to and the quality of educational services in the primary grade levels (K-3) in the ARMM. The Program has five components: 

a. Institutional strengthening;
b. Curriculum, Learning, and Delivery;
c. Teacher and Teaching Quality;
d. Policy, Planning, and Data Management; and
e. Governance, Management, and Program Operations.

The IPIF is a facility that will support project development and implementation of key infrastructure projects. IPIF support will cover such aspects as:

1.        Feasibility assessment, feasibility study;
2.        Detailed engineering design, including safeguards, project structure, economic analysis, financial assessment, procurement plan and implementation arrangements;
3.        Preparation of procurement documents ready for tendering; and
4.        Due diligence reviews of feasibility studies and detailed engineering designs.

This project includes the rehabilitation of pumping stations located in Manila, Pasay, Taguig, Makati, and Malabon through the replacement of pumps, and the construction of new pumping stations in Manila, Pasay, Pasig, Mandaluyong, San Juan, Caloocan, Valenzuela, and Quezon City. It will also minimize solid waste in waterways to reduce flood risks. The project also involves participatory housing and resettlement.  The project has the following components:
 
a. Rehabilitation of 36 pumping stations through replacement of pumps and construction of 20 new pumping stations;
b. Minimize solid waste in waterways;
c. Participatory housing and resettlement; and 
d. Project management, support and coordination.
